import React, {useEffect, useState} from 'react';
import {fetchAllList} from "../http/listAPI";
import {Row} from "react-bootstrap";

const Full = () => {
    const [fullList,setFullList]=useState('')
    useEffect(()=>{
        fetchAllList().then(data=> setFullList(JSON.parse(JSON.stringify(data))))
    },[])

   // const list=JSON.parse(fullList)

    console.log(fullList)
    return (
        <div>
            <Row>
            {
                fullList.map(obj=>
                <Row> {obj.fio}</Row>
                )
            }
            </Row>
        </div>
    );
};

export default Full;
